import React, { useState } from "react";

const InputRoadName = () => {
    const [roadName, setRoadName] = useState('');

    const onChange = (event) => {
      const {
          target: {
              name, value
          }
      } = event;
      if (name === "road-name") {
          setRoadName(value);
      }
  }; 
  return (
    <>
      <input name="road-name" onChange={onChange} value={roadName} placeholder="산책로 이름을 입력하세요" required/>
    </>
  );
};

export default InputRoadName;
